import React from 'react'

const Pagination = (tabledata) => {
    console.log(tabledata.tabledata)
    return (
        <table className='table'>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Gender</th>
                    <th>Email</th>
                    <th>Mobile no.</th>
                    <th>Occupation</th>

                </tr>
            </thead>

            <tbody>

                {tabledata.tabledata.map(item => {
                        return (


                        <tr>
                            <td>
                                {item.Name}

                            </td>
                            <td>
                                {item.Gender}
                            </td>
                            <td>
                                {item.Email}
                            </td>
                            <td>
                                {item.Name}
                            </td>
                            <td>
                                {item.Name}
                            </td>
                        </tr>

)
                    })}

            </tbody>

        </table>
    )
}

export default Pagination
